export type Company = {
  id: number;
  name: string;
};

export const trustedCompanies: Company[] = [
  { id: 1, name: "Netflix" },
  { id: 2, name: "Airbnb" },
  { id: 3, name: "Spotify" },
  { id: 4, name: "Pinterest" },
  { id: 5, name: "Tesla" }
];
